    "contracts/V2/TreasuryV2.sol": {
      "content": "// SPDX-License-Identifier: UNLICENSED
pragma solidity 0.8.1;

import { SafeERC20, IERC20 } from "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import { SafeMath } from "@openzeppelin/contracts/utils/math/SafeMath.sol";
import { Ownable } from "@openzeppelin/contracts/access/Ownable.sol";
import { EnumerableSet } from "@openzeppelin/contracts/utils/structs/EnumerableSet.sol";
import { ERC1155Receiver } from "./ERC1155/ERC1155Receiver.sol";
import { IStakingFacet } from "../Aavegotchi/interfaces/IStakingFacet.sol";
import { ITicketsFacet } from "../Aavegotchi/interfaces/ITicketsFacet.sol";

contract TreasuryV2 is Ownable, ERC1155Receiver {
  using SafeMath for uint256;
  using EnumerableSet for EnumerableSet.AddressSet;

  IERC20 public immutable GHST;

  EnumerableSet.AddressSet internal _whitelistedServices;
  IStakingFacet public immutable stakingFacet;
  ITicketsFacet public immutable ticketsFacet;

  mapping(address => uint256) public userBalance;

  constructor(address _stakingDiamond, address _GHST) {
    stakingFacet = IStakingFacet(_stakingDiamond);
    ticketsFacet = ITicketsFacet(_stakingDiamond);
    GHST = IERC20(_GHST);
  }

  function depositToAccount(uint256 _amt, address _receiver) public payable {
    SafeERC20.safeTransferFrom(GHST, msg.sender, address(this), _amt);

    stakingFacet.stakeGhst(_amt);

    userBalance[_receiver] = userBalance[_receiver].add(_amt);
  }

  function payWages(address _caringOwner, uint256 _rate) external {
    require(
      _whitelistedServices.contains(msg.sender),
      "Treasury: payWages: Caller not whitelisted"
    );
    require(
      _rate <= userBalance[_caringOwner],
      "Treasury: payWage: Account balance cannot be lower than rate"
    );

    userBalance[_caringOwner] = userBalance[_caringOwner].sub(_rate);

    address owner = owner();
    userBalance[owner] = userBalance[owner].add(_rate);
  }

  function withdrawFromAccount(uint256 _amt) public {
    require(
      _amt <= userBalance[msg.sender],
      "Treasury: Insufficient balance to withdraw"
    );

    stakingFacet.withdrawGhstStake(_amt);

    userBalance[msg.sender] = userBalance[msg.sender].sub(_amt);

    SafeERC20.safeTransfer(GHST, msg.sender, _amt);
  }

  function convertTickets(uint256[] calldata _ids, uint256[] calldata _values)
    external
    onlyOwner
  {
    stakingFacet.claimTickets(_ids, _values);
    ticketsFacet.safeBatchTransferFrom(
      address(this),
      owner(),
      _ids,
      _values,
      ""
    );
  }

  function whitelistService(address _service) external onlyOwner {
    require(
      !_whitelistedServices.contains(_service),
      "Treasury: whitelistService: Service already whitelisted"
    );
    _whitelistedServices.add(_service);
  }

  function removeService(address _service) external onlyOwner {
    require(
      _whitelistedServices.contains(_service),
      "Treasury: whitelistService: Service not whitelisted"
    );
    _whitelistedServices.remove(_service);
  }

  function getServices() external view returns (address[] memory services) {
    uint256 length = _whitelistedServices.length();
    services = new address[](length);
    for (uint256 i = 0; i < length; i++)
      services[i] = _whitelistedServices.at(i);
  }

  function approveStakingFacet() external onlyOwner {
    uint256 MAX_INT = 2**256 - 1;

    GHST.approve(address(stakingFacet), MAX_INT);
  }

  function onERC1155Received(
    address,
    address,
    uint256,
    uint256,
    bytes calldata
  ) external pure override returns (bytes4) {
    return
      bytes4(
        keccak256("onERC1155Received(address,address,uint256,uint256,bytes)")
      );
  }

  function onERC1155BatchReceived(
    address,
    address,
    uint256[] calldata,
    uint256[] calldata,
    bytes calldata
  ) external pure override returns (bytes4) {
    return
      bytes4(
        keccak256(
          "onERC1155BatchReceived(address,address,uint256[],uint256[],bytes)"
        )
      );
  }
}
"
